  const dispatch = useDispatch();
  const {userList} = useSelector((state)=>state.user);
  useEffect(()=> {
    dispatch(getUser())
  },[dispatch]);
  
  return (
    <div>
    hello
      {userList.map(el=>(
        <>
         
          <h6>{el.email} </h6>
          <h5>[</h5>

        </>
      ))}
    </div>
  )
};

export default ListAdmin
